    /**
     * Define el constructor del presentador.
     * @param vista Interfaz de usuario a ser enlazada con el presentador.
     */
    public MapActivityPresenter(MapActivityView vista) {
        this.vista = vista;
        rutas = new ArrayList<>();
        paradas = new ArrayList<>();
        paradasRutas = new ArrayList<>();
        puntos = new ArrayList<>();
        baseDatos = new SQLiteDataBase((Context) vista);
        if (baseDatos.obtenerRutas().size() == 0){
            registrarParadas();
            registrarRutas();
            registrarParadaRutas();
            registrarPuntosRuta1();
            registrarPuntosRuta2Zac();
            registrarPuntosRuta2Gdpe();
            registrarPuntosRuta3();
            registrarPuntosRuta4();
            registrarPuntosRuta5();
            registrarPuntosRuta6();
            registrarPuntosRuta7();
            registrarPuntosRuta8();
            registrarPuntosRuta14();
            registrarPuntosRuta15();
            registrarPuntosRuta16();
            registrarPuntosRuta17();
            registrarPuntosTransportesDeGuadalupe();
            registrarPuntosTransportesDeGuadalupeTyL();
            llenarBaseDeDatos();
        }
    }

    /**
     * Extrae todas las paradas de autobuses que existen en la base de datos.
     */
    public void cargarParadas() {
        List<Parada> listaParadas = baseDatos.obtenerParadas();
        if(listaParadas != null) {
            vista.mostrarParadas(listaParadas);
        } else {
            vista.mostrarErrorParadas();
        }
    }

    /**
     * Extrae de la base de datos las paradas de autobuses correspondientes a una ruta.
     */
    public void cargarParadasRuta(Integer idRuta) {
        List<Parada> listaParadas = baseDatos.obtenerParadasRuta(idRuta);
        if(listaParadas != null) {
            vista.mostrarParadas(listaParadas);
        } else {
            vista.mostrarErrorParadas();
        }
    }

    /**
     * Extrae la información de las rutas que se detienen en una determinada parada de autobus.
     * @param idParada Identificador de la parada a consultar sus rutas.
     * @param marcador Punto del mapa donde se mostrará la información de las rutas
     *                 que se detienen ahí.
     */
    public void cargarInfoParada(Integer idParada, Marker marcador) {
        List<Ruta> listaRutas = baseDatos.obtenerRutasPorParada(idParada);
        if(listaRutas !=  null) {
            vista.mostrarInfoParada(listaRutas, marcador);
        } else {
            vista.mostrarErrorInfoParada();
        }
    }

    /**
     * Encuentra las rutas más óptimas para llegar a la localización
     * indicada.
     * @param localizacion Coordenadas del lugar a llegar.
     */
    public void cargarOpcionesDeRuta(LatLng localizacion) {
        // Inicializar la ubicación de destino
        ubicacionDestino = localizacion;
        // Se obtienen todas las paradas de la base de datos.
        List<Parada> listaParadas = baseDatos.obtenerParadas();
        // Se buscan las paradas cercanas al destino elegido.
        paradasCercanas = BuscadorParada.
                buscarParadasCercanas(localizacion, listaParadas);

        List<Ruta> rutasOptimas = new ArrayList<>();
        for(Parada parada : paradasCercanas) {
            // Se buscan las rutas que pasan por cada parada cercana.
            List<Ruta> rutasParada = baseDatos.obtenerRutasPorParada(parada.getId());
            for(Ruta ruta : rutasParada) {
                // Se agregan dichas rutas a la lista de rutas óptimas.
                if(!rutasOptimas.contains(ruta)) {
                    rutasOptimas.add(ruta);
                }
            }
        }
        vista.mostrarOpcionesDeRuta(rutasOptimas);
    }

    /**
     * Encuentra la parada en la que el usuario debería subir con base en una ruta seleccionada.
     * @param ruta Ruta seleccionada por el usuario.
     * @param localizacion Localización actual del usuario.
     */
    public void cargarParadaSubida(Ruta ruta, LatLng localizacion) {
        //Ubicación actual del usuario
        ubicacionActual = localizacion;

        // Se obtienen todas las paradas de la base de datos.
        List<Parada> paradasUbicacion = baseDatos.obtenerParadas();

        // Paradas cercanas por donde pasa la ruta deseada
        List<Parada> paradasPreliminares = new ArrayList<>();
        // Buscar la parada más cercana por la que pasa esa ruta entre las paradas cercanas
        for (Parada parada : paradasUbicacion){
            // Saber qué rutas pasan por esa parada
            List<Ruta> rutasParada = baseDatos.obtenerRutasPorParada(parada.getId());
            // Si la ruta deseada pasa por esa parada se selecciona la parada como candidato a parada más cercana
            if (rutasParada.contains(ruta)){
                paradasPreliminares.add(parada);
            }
        }
        // Buscar parada más cercana al destino
        paradaSubida = BuscadorParada.buscarParadaCercana(ubicacionActual, paradasPreliminares);
        vista.resaltarParadaSubida(paradaSubida);
    }

    /**
     * Encuentra la parada en la que el usuario debería bajar con base en una ruta seleccionada, a
     * fin de llegar a su destino en el menor tiempo posible.
     * @param ruta Ruta seleccionada por el usuario. 
     */
    public void cargarParadaBajada(Ruta ruta) {
        // Paradas cercanas por donde pasa la ruta deseada
        List<Parada> paradasPreliminares = new ArrayList<>();
        // Buscar la parada más cercana por la que pasa esa ruta entre las paradas cercanas
        for (Parada parada : paradasCercanas){
            // Saber qué rutas pasan por esa parada
            List<Ruta> rutasParada = baseDatos.obtenerRutasPorParada(parada.getId());
            // Si la ruta deseada pasa por esa parada se selecciona la parada como candidato a parada más cercana
            if (rutasParada.contains(ruta)){
                paradasPreliminares.add(parada);
            }
        }
        // Buscar parada más cercana al destino
        paradaBajada = BuscadorParada.buscarParadaCercana(ubicacionDestino, paradasPreliminares);
        vista.resaltarParadaBajada(paradaBajada);
    }

    /**
     * Muestra el recorrido de una ruta en el mapa.
     * @param ruta La ruta de la cual se mostrara su recorrido.
     */
    public void cargarRecorridoRuta(Ruta ruta) {
        List<PuntoRuta> puntos = baseDatos.obtenerPuntosRuta(ruta.getId());
        if (puntos != null){
            vista.mostrarRecorridoRuta(puntos,ruta);
        }
    }

    /**
     * Obtiene todas las rutas almacenadas en la base de datos.
     */
    public void cargarRutas() {
        List<Ruta> listaRutas = new ArrayList<>();
        // Se obtienen todas las rutas de la base de datos
        listaRutas = baseDatos.obtenerRutas();
        if(listaRutas != null) {
            // No hubo problemas al obtener las rutas.
            vista.mostrarRutas(listaRutas);
        }
    }

    /**
     * Cálcula la distancia que hay entre la localización y la parada
     * de bajada para lanzar la alerta de proximidad si se está a
     * 500 metros o menos de distancia.
     * @param localizacion Nueva localización
     */
    public void actualizarUbicacion(LatLng localizacion) {
        Double distancia = SphericalUtil.computeDistanceBetween(localizacion,
                new LatLng(paradaBajada.getLatitud(), paradaBajada.getLongitud()));

        if(distancia <= 500) {
            vista.mostrarAlertaBajada();
        }
    }

    private void llenarBaseDeDatos(){
        baseDatos.agregarRutas(rutas);
        baseDatos.agregarParadas(paradas);
        baseDatos.agregarParadasRuta(paradasRutas);
        baseDatos.agregarPuntosRuta(puntos);
    }

